eval("// Module\nvar code = \"<template>\\r\\n    <compose view=\\\"../../resources/elements/header.html\\\"></compose>\\r\\n    <div class=\\\"section\\\" id=\\\"firstSection\\\">\\r\\n        <div class=\\\"container\\\">\\r\\n            <div class=\\\"row\\\">\\r\\n                <h2>New Frontiers in Enterprise Systems Research and Practice</h2>\\r\\n                <p>The SAP North America Academic Community (SAPNAAC) is excited to announce Academic Community Conference 2021 (AC21) held online on September 11-12, 2021. The Conference agenda revolves around keynote presentations from industry leaders, paper presentations, and a networking event. We will also coordinate joint events with colleagues in the SAP Academic Board DACH in Europe for new opportunities to foster a growing global network focused on innovation in research, teaching, and practice in enterprise systems.</p>\\r\\n\\r\\n                <p>AC21 is seeking extended abstracts/research in progress on various topics exploring new technologies and issues in enterprise systems from multiple perspectives. These include but are not limited to fundamental research, practice-oriented cases, emerging areas such blockchain/robotic process automation/cloud computing/AI augmentation, and classroom use of enterprise systems. </p>\\r\\n\\r\\n<p>AC21 is a wonderful avenue to present research in progress and seek constructive feedback.  AC21 also provides high-value networking opportunities with academics and industry professionals. Please see the full call for papers below submit today! Submissions are accepted through August 1, 2021.</p>\\r\\n\\r\\n<p></p>All research papers will be double-blind peer-reviewed. They will be shared in the conference proceedings after being presented. Proceedings from prior conferences can be found in the SAPNAAC Library.  Additionally, each track will host a best paper award to recognize the top contributors. Note that all papers are to be submitted as an extended abstract no later than August 1st, 2021. Authors will receive notification of acceptance by August 16, 2021. They will be expected to have camera-ready final submissions ready for September 1, 2021.\\r\\nPaper submissions should follow this template and be submitted to the most suitable of the four research tracks available (described below). </p>\\r\\n\\r\\n<p>In addition to the research paper tracks, as track 5, we are hosting Teaching, Research, Education, and Diversity (TRED) Talks, which will accept 1-page proposals for shorter presentations until August 15, 2021. Submissions to the TRED Talks will be editorially reviewed and published in the proceedings as 1-page abstracts.</p>\\r\\nConference Registration ($50 cost) <h3><a class=\\\"btn btn-primary\\\"  href=\\\"#confRegister\\\">Register for the conference</a></h3> \\r\\n\\r\\n<h4>Dates: September 11-12, 2021 (Online)</h4>\\r\\n \\r\\n<div class=\\\"row\\\">\\r\\n    <compose view=\\\"./callForPapers2021.html\\\"></compose>\\r\\n</div>\\r\\n\\r\\n                <!-- <p>\\r\\n                    After a one year absence, the SAPNAAC Academic Board is pleased to \\r\\n                    announce the conference will be held September 11-12, 2021. This virtual event will \\r\\n                    include keynotes, presentations by faculty, as well as virtual social events. Don't miss the \\r\\n                    opportunity to interact with fellow faculty and partners. <span class=\\\"bold\\\">The fee for the conference is ${fee}, payable at time of registration</span>\\r\\n                </p>\\r\\n                <h3 class=\\\"bigTopMargin\\\">Schedule</h3>\\r\\n                <h4>September 11-12, 2021</h4>\\r\\n                <p>Virtual presentations by fellow faculty and industry representatives.</p>\\r\\n            </div>\\r\\n            <h3><a class=\\\"btn btn-primary\\\"  href=\\\"#confRegister\\\">Register for the conference</a></h3>\\r\\n            <div class=\\\"row\\\">\\r\\n                <compose view=\\\"./callForPapers2021.html\\\"></compose>\\r\\n            </div> -->\\r\\n        </div>\\r\\n    </div>\\r\\n    <compose view=\\\"../../resources/elements/footer.html\\\"></compose>\\r\\n</template>\";\n// Exports\nmodule.exports = code;//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///modules/site/conf2021.html\n");

